import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

const HeaderContainer = styled.header`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  background: white;
  box-shadow: 0 2px 5px rgba(0,0,0,0.1);
  z-index: 1000;
`;

const Nav = styled.nav`
  max-width: 1200px;
  margin: 0 auto;
  padding: 20px;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const Logo = styled(Link)`
  font-size: 24px;
  font-weight: bold;
  text-decoration: none;
  color: #333;
`;

const HeroSection = styled.div`
  width: 100%;
  height: 500px;
  margin-top: 80px;
  background-color: #f5f5f5;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Header = () => {
  return (
    <>
      <HeaderContainer>
        <Nav>
          <Logo to="/">Thekeynote</Logo>
        </Nav>
      </HeaderContainer>
      <HeroSection>
        <h1>Welcome to Thekeynote</h1>
      </HeroSection>
    </>
  );
};

export default Header;
